import React, { Fragment } from 'react';
import MaterialTable from 'material-table'
import TableIcons from '../../common/materialicon'
import Input from '../../common/input'
import Button from '../../common/button'
import Combobox from '../../common/combobox'
import HistoryReport from '../../../core/report'


export default class LockerHistoryReport extends React.Component {

    labelInput = '';
    eNameInput = '';
    eCodeInput = '';

    columns = [
        { 
            title: 'Tòa nhà', 
            field: 'bName'
        },
        { 
            title: 'Tầng', 
            field: 'lLv'
        },
        { 
            title: 'Tủ',
             field: 'lLabel' },
        { 
            title: 'Hành động', 
            field: 'act',
            render: rowData => {
                if (rowData.act === 'DROPOFF') {
                    return(
                        <span style={{color: 'green'}}>
                            trả tủ
                        </span>
                    )
                }
                else if (rowData.act === 'PICKUP_HOLD'){
                    return(
                        <span style={{color: 'gray'}}>
                            mở tủ
                        </span>
                    )
                }
                else {
                    return(
                        <span style={{color: 'gray'}}>
                            Mở từ web
                        </span>
                    )
                }

            }
        },
        { 
            title: 'Trạng thái cánh tủ', 
            field: 'dState',
            render: rowData => {
                if ( rowData.dState === 'OPEN') {
                    return(
                        <span style={{color: 'grên'}}>
                            cánh tủ mở
                        </span>
                    )
                }
                else 
                {
                    return(
                        <span style={{color: 'red'}}>
                            cánh tử đóng
                        </span>
                    )
                }
                
            }
        },
        { 
            title: 'Người sử dụng cuối cùng',
             field: 'eName' 
        },
        { 
            title: 'ID nhân sự',
             field: 'eCode' 
        },
        { 
            title: 'Thời điểm thao tác cuối cùng',
             field: 'aTime' 
        },
       
    ]

    options1 = {
        search: false,
        showTitle: false,
        pageSize: 20,
        pageSizeOptions: [20],
    } 

    constructor(props) {
        super(props);
        this.state = {

        };
    }

    onLabelChange  = (value) => 
    {
        this.labelInput = value;
    }

    onENameChange = (value) => {
        this.eNameInput = value;
    }

    onECodeChange = (value) => {
        this.eCodeInput = value;
    }

    getDataFromServer = (query) => {
        return new Promise((resolve, reject) => {
            HistoryReport.getHistoryReport(0,0,'', this.labelInput, this.eNameInput, this.eCodeInput, '', '', query.page +1)
            .then(value => {
                resolve({
                    data: value.items,
                    page: value.currentPage - 1,
                    totalCount: value.total,
                })            
            })
        })
    }

    componentDidMount() {
    }

    render() {
        return(
            <Fragment>
                <div style={{display: 'flex' }}>
                    <Combobox
                     title={'Tòa nhà'} 
                    />
                    <Combobox
                     title={'Tầng'} 
                    />
                    <Combobox
                     title={'Thiết bộ quản lý'} 
                     />
                    <Input 
                        title={'Nhãn tủ'}
                        onChange={this.onLabelChange} 
                    />
                    <Input 
                        title={'Tên nhân viên'} 
                        onChange={this.onENameChange} 
                    />
                    <Input 
                        title={'ID nhân sự'} 
                        onChange={this.onECodeChange} 
                    />                   
                </div>
                <div  style={{display: 'flex', width: '50%'}}>
                <Combobox title={'Ngày bắt đầu'}/>
                <Combobox title={'Ngày kết thúc'} />
                <Button title={'Tìm kiếm'}
                        onClick={this.onSearchClick} />
                </div>
                <MaterialTable
                 options={this.options1}
                 icons={TableIcons}
                 columns={this.columns}
                 data={this.getDataFromServer}
                 title="LockerHistoryReport"
                />
                
            </Fragment>
        )
    }
}
